import React from 'react'
import { Link } from "react-router-dom";
import { Navbar } from "react-bulma-components";

export default function Nav() {

    return (
        <Navbar>
            <h3>Card Tracker</h3>
                <Link to="/">
                    <li>Home</li>
                </Link>
        </Navbar>

    ) 
}
